import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // First perform a search to get to a page with view controls
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', 'electronics');
    await page.click('.search-btn');

    // Wait for results page to load
    await page.waitForSelector('.sort-filter-controls', { timeout: 5000 });

    // Take screenshot after search
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_search.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_search.png'));

    // Find and click the list view button
    await page.waitForSelector('.view-toggle', { timeout: 5000 });
    const listViewButton = await page.$('button[title="List View"]');

    if (listViewButton) {
      await listViewButton.click();

      // Wait for view to switch and take screenshot
      await page.waitForSelector('.products-list', { timeout: 5000 });
      await page.screenshot({ path: path.join(screenshotsDir, 'step_3_list_view.png') });
      screenshots.push(path.join(screenshotsDir, 'step_3_list_view.png'));

      // Verify list view is active
      const isListViewActive = await page.$eval('button[title="List View"]', 
        btn => btn.classList.contains('active'));

      return {
        success: true,
        action: "Switched to list view mode successfully",
        extractedData: {
          viewMode: "list",
          isActive: isListViewActive
        },
        screenshots,
        error: null
      };
    } else {
      throw new Error('List view button not found');
    }
  } catch (error) {
    return {
      success: false,
      action: "Failed to switch to list view mode",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
